tables.table_schema:
CREATE TABLE CuisineSales (
    cuisine_id INT PRIMARY KEY,
    cuisine_name VARCHAR(50),
    total_sales DECIMAL(10, 2),
    year INT
);

CREATE TABLE CuisineProfitability (
    cuisine_id INT PRIMARY KEY,
    net_profit DECIMAL(10, 2),
    year INT
);

CREATE TABLE Sales (
    sale_id INT PRIMARY KEY,
    cuisine_type VARCHAR(255),
    sale_amount DECIMAL(10, 2)
);

CREATE TABLE Expenses (
    expense_id INT PRIMARY KEY,
    expense_category VARCHAR(255),
    expense_amount DECIMAL(10, 2)
);

CREATE TABLE cuisine_sales (
    cuisine_id INT PRIMARY KEY,
    cuisine_name VARCHAR(50) NOT NULL,
    total_sales DECIMAL(10, 2) NOT NULL,
    sales_date DATE NOT NULL
);

CREATE TABLE cuisine_profit (
    profit_id INT PRIMARY KEY,
    cuisine_id INT NOT NULL,
    net_profit DECIMAL(10, 2) NOT NULL,
    profit_date DATE NOT NULL
);

CREATE TABLE cuisine_categories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(50) NOT NULL
);

CREATE TABLE cuisine_locations (
    location_id INT PRIMARY KEY,
    cuisine_id INT NOT NULL,
    location_name VARCHAR(50) NOT NULL,
    country VARCHAR(50) NOT NULL
);
